import React, { Component, Fragment } from 'react'

class Header extends Component {
    render() {
        return (
            <Fragment>
                <div style={{
                    display:"flex",
                    alignItems:"self-end"
                }}>
                    <div style={{
                        left:"1%",
                        position: "relative"    
                    }}>
                        Goverment of India | भारत सरकार 
                    </div>

                    <div style={{
                        right: "1%" ,
                        position: "absolute"
                    }}>
                        ग्राम विकास मंत्रालय | Ministry of Rural Development
                    </div>

                </div>
            </Fragment>
        )
    }
}

export default Header;
